import React from "react";
import PropTypes from "prop-types";
import "./side.css";

Side.prototype = {};

function Side(props) {
  return (
    <div className="sideBar">
      <a href="">All Task</a>
      <a href="">New Task</a>
      <a href="">Doing Task</a>
      <a href="">Done Task</a>
    </div>
  );
}

export default side;
